import{_ as e,c as a,o,aj as i,bF as s,bG as l,bH as r,bI as n,bJ as c,bK as d,bL as u,bM as m,aC as p,aD as h,bN as g,bO as y,bP as b,at as _,bQ as f,bR as v}from"./chunks/framework.D6_Aedov.js";const S=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"qobuz.md","filePath":"qobuz.md"}'),x={name:"qobuz.md"};function q(w,t,k,P,Q,z){return o(),a("div",null,[...t[0]||(t[0]=[i('<h2 id="_1-preparation" tabindex="-1">1. Preparation <a class="header-anchor" href="#_1-preparation" aria-label="Permalink to “1. Preparation”">​</a></h2><p>Before using the Qobuz music service, you need a valid Qobuz account.</p><p>For first-time login, open Qobuz on your device under &quot;Streaming&quot; - &quot;Music&quot;, or open it in the Eversolo Control app under &quot;Discover&quot; - &quot;Music Services&quot;. Follow the on-screen prompts to complete login.</p><div class="two-images"><img src="'+s+'" alt=""><img src="'+l+'" alt=""></div><h2 id="_2-log-in" tabindex="-1">2. Log In <a class="header-anchor" href="#_2-log-in" aria-label="Permalink to “2. Log In”">​</a></h2><p>Enter your Qobuz account and password on your device or in the Eversolo Control app to log in.</p><p>If you haven&#39;t created a Qobuz account yet, click &quot;Sign in&quot; and follow the prompts to register.</p><div class="two-images"><img src="'+r+'" alt=""><img src="'+n+'" alt=""></div><h2 id="_3-browsing" tabindex="-1">3. Browsing <a class="header-anchor" href="#_3-browsing" aria-label="Permalink to “3. Browsing”">​</a></h2><p>After successfully logging in, you can browse Qobuz music on your device or in the Eversolo Control app. At the top of the interface, you will see sections for Discover, My Weekly Q, My playlists, Genres, and Favorites.</p><p>You can browse these categories layer by layer to access various recommended content from Qobuz&#39;s curated music selections. You can also view your favorite custom playlists, recent releases, and artists in the Favorites section.</p><div class="two-images"><img src="'+c+'" alt=""><img src="'+d+'" alt=""></div><h2 id="_4-search" tabindex="-1">4. Search <a class="header-anchor" href="#_4-search" aria-label="Permalink to “4. Search”">​</a></h2><p>Click the search box at the top to search the entire Qobuz music library, finding Artists,Albums, Tracks, Playlists, and more to quickly locate your favorite music resources.</p><div class="two-images"><img src="'+u+'" alt=""><img src="'+m+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_5-more" tabindex="-1">5. More <a class="header-anchor" href="#_5-more" aria-label="Permalink to “5. More”">​</a></h2><p>In the browsing interface, you can access the more functions menu by clicking the &quot;<img class="imgIcon" src="'+p+'" alt="">&quot; icon to the right of a track or the &quot;<img class="imgIcon" src="'+h+'" alt="">&quot; icon in the upper right corner of an album/playlist.</p><p>This menu supports the following functions:</p><table tabindex="0"><thead><tr><th style="text-align:left;">More menus for singles</th><th style="text-align:left;">More menus for albums/playlists</th></tr></thead><tbody><tr><td style="text-align:left;">Play now / Play next</td><td style="text-align:left;">Play all tracks now</td></tr><tr><td style="text-align:left;">Add to the end of play queue</td><td style="text-align:left;">Add all tracks to the next play</td></tr><tr><td style="text-align:left;">Add to device playlist</td><td style="text-align:left;">Add all tracks to the end of the play queue</td></tr><tr><td style="text-align:left;">Favorite to Qobuz</td><td style="text-align:left;">Add to device playlist</td></tr><tr><td style="text-align:left;">Add to Qobuz playlist</td><td style="text-align:left;">Favorite to Qobuz</td></tr><tr><td style="text-align:left;">View artist</td><td style="text-align:left;">Add all tracks to Qobuz playlist</td></tr><tr><td style="text-align:left;">View album</td><td style="text-align:left;">/</td></tr></tbody></table><p><strong>Tips:</strong></p><ul><li>Saved content can be viewed and managed at any time in the &quot;My Collection&quot; section.</li><li>Content added to your device&#39;s playlist can be viewed and managed centrally in My Favorites - Device Playlists.</li></ul><div class="two-images"><img src="'+g+'" alt=""><img src="'+y+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_6-streaming-quality" tabindex="-1">6. Streaming Quality <a class="header-anchor" href="#_6-streaming-quality" aria-label="Permalink to “6. Streaming Quality”">​</a></h2><p>When using the TIDAL music service, you can select the Streaming Quality mode by clicking the &quot;<img class="imgIcon" src="'+b+'" alt="">&quot; icon in the upper right corner of the homepage or by clicking the &quot;<img class="imgIcon" src="'+_+'" alt="">&quot; icon on the playback details screen.</p><p>Supported options include:</p><ul><li>Low</li><li>Medium（128 kb/s）</li><li>Hight（320 kb/s）</li><li>Lossless（CD-Quality）</li><li>HiRes（MAX/Master）</li></ul><div class="two-images"><img src="'+f+'" alt=""><img src="'+v+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div>',30)])])}const M=e(x,[["render",q]]);export{S as __pageData,M as default};
